import React from "react";
import { connect } from "react-redux";

const mapStateToprops = state => {
    return { articles: state.articles};
};

const connectedList = ({ articles }) => (
    <div>
    <ul>
        {articles.map(el => (
            <li key={el.id}>
                {el.title}
            </li>
        ))}
    </ul>
    </div>
);

export default connect(
    mapStateToprops
)(connectedList)
